//获取待入任务表格数据
function wait_inTable() {

    var table = KANBAN_DATA.data.data6
    var html = "";
    // console.log(table.length)
    for (var i = 0; i < table.length; i++) {
        html += '<tr><td>' + "&nbsp" + "&nbsp" + table[i].序号 + '</td><td>' + table[i].入库单号 + '</td><td>' + table[i].下发时间.substring(11) + '</td></tr>';
        if (i == table.length - 1) {
            html += '<tr style="height: 15px"></tr>'
        }
    }
    // console.log(html)
    $("#wait_inTable").empty();
    $("#wait_inTable").append(html);
    $("#wait_inTable1").empty();
    $("#wait_inTable1").append(html)
    if (MyMarhq != null) {
        clearInterval(MyMarhq);
        MyMarhq = null;
    }
    var item = $('.tbl-body tbody tr').length
    // console.log(item)

    if (item > 5) {
        $('.tbl-body tbody').html(
            $('.tbl-body tbody').html() + $('.tbl-body tbody').html());
        $('.tbl-body').css('top', '0');
        var tblTop = 0;
        var speedhq = 90; // 数值越大越慢
        var outerHeight = $('.tbl-body tbody').find("tr").outerHeight();
        function Marqueehq() {
            if (tblTop <= -outerHeight * item) {
                tblTop = 0;
            } else {
                tblTop -= 1;
            }
            $('.tbl-body').css('top', tblTop + 'px');
        }

        MyMarhq = setInterval(Marqueehq, speedhq);
    } else {
        $('.tbl-body').css('top', '0');// 内容少时不滚动
    }

}

